import React, { Component } from 'react'

class Pagination extends Component {
    state = {
        currentPage: 1,
        totalPages: this.props.totalPages || 1,
        pageToShow: this.props.pageToShow || 5,
    }

    render() {
        return <h1>Pagination</h1>
    }
}

export default Pagination
